export default {
  data: function data() {
    return {
      topList: [],
      currentTime: null,
      currentMouth: null,
      updateTime: 0,
      userid: null,
      userList: [],
      userScore: 0
    };
  },
  created: function created() {
    this.current();
    this.getBabyRanking();
  },
  methods: {
    getBabyRanking: function getBabyRanking() {
      var _this = this;

      var self = this;
      this.$axios.getBabyRanking(this.currentTime).then(function (res) {
        _this.topList = res.data.data.list;
        var babyArray = res.data.data.list;
        _this.updateTime = res.data.data.updatetime;
        _this.userid = localStorage.getItem('user');
        babyArray.forEach(function (value, index) {
          if (value.userId == self.userid) {
            self.userList = value;
            self.userScore = index + 1;
          }
        });
      })["catch"](function (err) {});
    },
    current: function current() {
      var dd = new Date();
      var y = dd.getFullYear();
      var m = dd.getMonth() + 1; //获取当前月份的日期

      var d = dd.getDate();
      this.currentTime = y + '-' + m + '-' + d;
      this.currentMouth = m;
    }
  },
  components: {}
};
